import { useState } from 'react';
import useStyles from './useStyles';
import { Link, useHistory } from 'react-router-dom';
import { Tabs, Tab, Box } from '@material-ui/core';

const englishTabs = [{ label: 'new reservations', to: '/new-reservation' }];
const turkishTabs = [
                        { label: 'yeni rezervasyonlar', to: '/new-reservation' },
                        { label: 'rezervasyonlar', to: '/reservation' }
                    ]

function ClientHeader(): JSX.Element {

    return (
        <Box>
            <Tabs
                    aria-label="wrapped label tabs example"
                    TabIndicatorProps={{
                        style: {
                            display: "none",
                        },
                    }} 
                >
                    <Tab
                        label="yeni rezervasyonlar"
                        component={Link}
                        to='/new-reservation'
                    />
                    <Tab 
                        label="rezervasyonlar"
                        component={Link}
                        to='/reservation' 
                     />
                    <Tab value="three" label="finans" />
                </Tabs>
        </Box>
    )
}

export default ClientHeader;
